import React from "react";
import { Box, Typography } from "@mui/material";
import RuneRow from "./RuneRow";
import runeList from "../../utils/runes.json";
import { Rune } from "../../types/Rune";
import toRuneFormat from "../../utils/RuneFormatter";

interface PrimaryMasteryTreeProps {
  tree: number;
  selectedRunes: number[]; // identifie la rune choisie pour chaque slot
  row: Rune[] // doit contenir toutes les runes de l'arbre choisi
}
const PrimaryMasteryTree: React.FC<PrimaryMasteryTreeProps> = ({
  tree,
  selectedRunes: runes,
  row
}) => {
  console.log("toto",row);
  return (
    <Box sx={{ border: "1px solid #ccc", p: 1, maxWidth: "25%" }}>
      <RuneRow tree={tree} selectedRuneId={runes[0]} position={0} row={row} isKeystone={true}/>
      <RuneRow tree={tree} selectedRuneId={runes[1]} position={1} row={row} isKeystone={false}/>
      <RuneRow tree={tree} selectedRuneId={runes[2]} position={2} row={row} isKeystone={false}/>
      <RuneRow tree={tree} selectedRuneId={runes[3]} position={3} row={row} isKeystone={false}/>
    </Box>
  );
};
/*
<Typography variant="subtitle1" sx={{ mb: 2, color: "#F0E6D2" }}>
        {"Primary"}
      </Typography>
      */
export default PrimaryMasteryTree;
